import React from 'react'
import '../index.css';

const Notification = ( { message, errorMessage } ) => {
  if (errorMessage !== null) {
    return (
      <div className="error">
        {errorMessage}
      </div>
    )
  } else if (message !== null) {
    return (
      <div className="added">
        {message}
      </div>
    )
  }
  return null

}

export default Notification
